import react from "react";

function Details(props) {
    return (
        <div className="clothesCard">
            <img src={item.images[0]} />
            <div className="detail">
                <p className="name">{item.name}</p>
                <p className="price">{item.price}Rs</p>
            </div>
        </div>
    );
}

export default Details;
